import React, { useState, useEffect } from 'react';
import { supabase } from './supabaseClient';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  TimeScale,
  TimeSeriesScale,
  Filler,
  Colors
} from 'chart.js';
import { Line } from 'react-chartjs-2';
import 'chartjs-adapter-date-fns';
import { enUS } from 'date-fns/locale';

// Register ALL Chart.js components
ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  TimeScale,
  TimeSeriesScale,
  Filler,
  Colors
);

// Set default locale for date adapter
ChartJS.defaults.locale = 'enUS';

const Dashboard = ({ user }) => {
  const [airQualityData, setAirQualityData] = useState([]);
  const [chartData, setChartData] = useState(null);
  const [isLoading, setIsLoading] = useState(true);
  const [hasHVAC, setHasHVAC] = useState(false);
  const [hasEcologica, setHasEcologica] = useState(false);
  const [city, setCity] = useState('Toronto');
  const [firstName, setFirstName] = useState('');

  // Add effect to process chart data when airQualityData changes
  useEffect(() => {
    if (airQualityData.length > 0) {
      console.log('Processing air quality data for charts:', airQualityData);
      const processedData = {
        pm25: {
          labels: airQualityData.map(d => new Date(d.timestamp)),
          datasets: [{
            label: 'PM2.5',
            data: airQualityData.map(d => parseFloat(d.pm25)),
            borderColor: 'rgb(75, 192, 192)',
            tension: 0.1
          }]
        },
        pm10: {
          labels: airQualityData.map(d => new Date(d.timestamp)),
          datasets: [{
            label: 'PM10',
            data: airQualityData.map(d => parseFloat(d.pm10)),
            borderColor: 'rgb(153, 102, 255)',
            tension: 0.1
          }]
        }
      };
      console.log('Processed chart data:', processedData);
      setChartData(processedData);
    }
  }, [airQualityData]);

  useEffect(() => {
    const fetchPreferences = async () => {
      try {
        const { data, error } = await supabase
          .from('user_preferences')
          .select('*')
          .eq('user_id', user.id)
          .single();

        if (error) throw error;

        if (data) {
          setHasHVAC(data.has_HVAC);
          setHasEcologica(data.has_ecologgica);
          setFirstName(data.first_name || '');
          setCity(data.city || 'Toronto');
        }
      } catch (error) {
        console.error('Error fetching preferences:', error);
      }
    };

    const fetchAirQualityData = async () => {
      try {
        const response = await fetch('http://localhost:5000/api/airqualitydata');
        if (!response.ok) {
          throw new Error(`HTTP error! status: ${response.status}`);
        }
        const data = await response.json();
        console.log('Raw air quality data:', data);
        setAirQualityData(data);
      } catch (error) {
        console.error('Error fetching air quality:', error);
      } finally {
        setIsLoading(false);
      }
    };

    if (user) {
      fetchPreferences();
    }
    fetchAirQualityData();
  }, [user]);

  return (
    <div className="dashboard">
      <h1>{firstName ? `${firstName}'s ` : ''}{city} Dashboard</h1>

      <div className="chart-container">
        <div className="chart" style={{ height: '400px', width: '100%', position: 'relative' }}>
          <h2>PM2.5 Levels</h2>
          {chartData ? (
            <Line
              data={chartData.pm25}
              options={{
                responsive: true,
                maintainAspectRatio: false,
                scales: {
                  x: {
                    type: 'time',
                    time: {
                      unit: 'day'
                    }
                  },
                  y: {
                    beginAtZero: true
                  }
                }
              }}
            />
          ) : (
            <p>Loading data...</p>
          )}
        </div>

        <div className="chart" style={{ height: '400px', width: '100%', position: 'relative' }}>
          <h2>PM10 Levels</h2>
          {chartData ? (
            <Line
              data={chartData.pm10}
              options={{
                responsive: true,
                maintainAspectRatio: false,
                scales: {
                  x: {
                    type: 'time',
                    time: {
                      unit: 'day'
                    }
                  },
                  y: {
                    beginAtZero: true
                  }
                }
              }}
            />
          ) : (
            <p>Loading data...</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
